import React from "react";
import Card from "./Card";

const Service = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our Web Development Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card
                title="React JS"
                text="React has been designed from the start for gradual adoption, and you can use as little or as much React as you need. Whether you want to get a taste of React, add some interactivity to a simple HTML page, or start a complex React-powered app, the links in this section will help you get started."
                btn="Checkout"
              />
              <Card title="Bootstrap 5" text="This is text 2"  btn="Checkout" />
              <Card title="HTML5" text="This is text 3" btn="Checkout" />
              <Card title="CSS3" text="This is text 4" btn="Checkout" />
              <Card title="JavaScript" text="This is text 5" btn="Checkout" />
              <Card title="jQuery" text="This is text 6" btn="Checkout" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Service;
